import './About.css';
import Navbar from '../../Components/Navbar/Navbar';

const About = () => {
  return (
    <>
        
        <div className="about-container">
            <div className='para'>
                <h1>About Us</h1>
                <p>
                    Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed eget
                    lectus vitae nunc dignissim sagittis non vel metus. Donec id purus
                    ultricies, vehicula risus eget, convallis dui. Vestibulum ante ipsum
                    primis in faucibus orci luctus et ultrices posuere cubilia curae;
                    Phasellus vitae quam eu mi semper maximus. Nulla facilisi. Vestibulum
                    ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia
                    curae; Proin vitae consequat velit. In efficitur, est sed rutrum
                    dapibus, justo sem pretium dui, vel vehicula nulla lectus eget purus.
                    In sollicitudin auctor est, sed lacinia odio. Integer non mi at ex
                    gravida interdum ac eu justo. Nam aliquam elit non fermentum
                    sollicitudin. Nulla facilisi.
                </p>
                <p>
                    Mauris congue ipsum nulla, eu euismod felis sollicitudin eu. Sed nec
                    lacus ac sem ultricies fermentum. Nullam ut leo sit amet urna finibus
                    tristique. Suspendisse eget luctus odio, non vehicula mauris. Ut ac
                    semper libero, nec egestas magna. Sed nec nibh quis ligula placerat
                    ullamcorper vel eu nunc. Nam consequat varius lectus, eu tincidunt mi
                    congue sed.
                </p>
            </div>
        </div>
    </>
  );
};

export default About;
